'',
'    l_WorkflowPage apex_application_page_regions.attribute_01%type := p_region.attribute_01;',
'    l_WorkflowContainer apex_application_page_regions.attribute_02%type := p_region.attribute_02;',
'    l_config_json apex_application_page_regions.attribute_03%type := p_region.attribute_03;',
'',
'    l_result apex_plugin.t_region_render_result;',
'BEGIN',
'    l_http_string := ''<div id="'' || p_region.static_id || ''_Nist" class="NistContainer"></div>'';',
'',
'    SYS.HTP.PRN(l_http_string);',
'',
'',
'',
'',
'',
'',
'',
'',
'    IF l_config_json IS NULL THEN',
'        l_config_json := ''{}'';',
'    END IF;',
'',
'',
'',
'    APEX_JAVASCRIPT.add_onload_code(p_code =>  ''try { ''',
'                                  || ''$("#'' || p_region.static_id',
'                                  || ''_Nist").Nist({''',
'                                  || ''"static_id": "'' || p_region.static_id || ''"''',
'                                  || '', "ajax_identifier": "'' || apex_plugin.get_ajax_identifier() || ''"''',
'                                  || '', "language": "'' || APEX_UTIL.GET_SESSION_LANG || ''"''',
'                                  || '', "AppUser": "'' || V(''APP_USER'') || ''"''',
'                                  || '', "WorkflowPage": "'' || l_WorkflowPage || ''"''',
'                                  || '', "WorkflowContainer": "'' || l_WorkflowContainer || ''"''',
'',
'',
'',
'',
'',
'',
'',
'                                  || '', "config_json": '' || l_config_json',
'',
'',
'                                  || ''}); } catch (err) { console.error(err); }'');',
'',
'    return(l_result);',
'END render;',
'',
'',
'',
'',
'',
'FUNCTION ajax(',
'  p_region IN apex_plugin.t_region,',
'  p_plugin IN apex_plugin.t_plugin',
') RETURN apex_plugin.t_region_ajax_result',
'IS',
'l_ajax_result apex_plugin.t_region_ajax_result;',
