'  -- apex_debug.enable(/* severity level */ 1);',
'  -- apex_plugin_util.debug_region(p_plugin, p_region);',
'',
'  IF :APP_AJAX_X01 IS NULL',
'  THEN',
'    RAISE_APPLICATION_ERROR(-20001, ''Missing context name in :APP_AJAX_X01 for the AJAX request to send!'');',
'  END IF;',
'',
'  CASE :APP_AJAX_X01',
'    WHEN PKG_DL_I18N.gc_context_name',
'    THEN',
'      l_ajax_result := PKG_DL_I18N.process_ajax_region_request(p_region, p_plugin);',
'    ELSE',
'      l_ajax_result := PKG_DL_PLUGIN_AJAX.process_ajax_region_request(p_region, p_plugin);',
'  END CASE;',
'',
'  RETURN l_ajax_result;',
'',
'END ajax;',
'',
''))
